import React from "react";
import '../assets/VeXemPhim.css'

export default function VeXemPhim() {
  return (
    <div
        className="bookingMovie"
      style={{
        position: "fixed",
        width: "100%",
        height: "100%",
        backgroundImage: 'url("./img/VeXemPhim/bgmovie.jpg")',
        backgroundSize: "100%",
      }}
    >
      <div
        style={{
          position: "fixed",
          width: "100%",
          height: "100%",
          backgroundColor: "rgba(0,0,0,0.7)",
        }}
      >
        <div className="container-fluid">
          <div className="row">
            <div className="col-8">
                <h1 className="text-light">ĐẶT VÉ XEM PHIM CYBERLEARN.VN</h1>
                    <div className="text-light" style={{fontSize:'15px'}}>Màn Hình</div>
                <div className="mt-5" style={{display:'flex',flexDirection:'row',justifyContent:'center'}}>
                <div className="screen"></div>
                </div>
            </div>
            <div className="col-4"></div>
          </div>
        </div>
      </div>
    </div>
  );
}
